import React from 'react';
import Card from './components/card/Card';
import './global.css';
import { Cartao, Container } from './styles';

function App() {
  return (
    <Container>
      <Card cliente="roberto" funcionario="leia" tratamento="hidratacao" telefone="64 9999 89989" ></Card>
      <Card cliente="jorge" funcionario="leia" tratamento="hidratacao" telefone="64 9999 89989" ></Card>
    </Container>
  );
}
export default App;
